import React, { Component, useEffect } from 'react';
//import axios from 'axios';


class PredictionPage extends Component {
    constructor(props) {
        super(props)
        this.state = {
            categories: [
                {category: "jeans", prediction: "95%"}
            ]
        }
        }

    renderTableData() {
        return this.state.categories.map((item, index) => {
            const {category, prediction} = item
            return (
                <tr key={category}>
                    <td>{category}</td>
                    <td>{prediction}</td>
                </tr>
            )
        })
    }

    render() {
        return (
            <div>
                <h1>This is our prediction blah blah blah</h1>
                <h2>Confidence Prediction Table</h2>
                <table id={"categories"}>
                    <tbody>
                    {this.renderTableData()}
                    </tbody>
                </table>
            </div>
        )
    }
}



export default PredictionPage;
